import React from 'react';
import UserCard from './UserCard';

const UserList = ({users}) => {
    return(
        <div>
            {
            users.map((user, i) => {
                return(
                    <UserCard 
                        name={users[i].name} 
                        userType={users[i].role}
                        onclick={this.props.onclick}
                    />
                ); 
            })
            }
        </div>
    );
}

export default UserList;
